import express from 'express';

const PORT = 4000;

const app = express();


//express, route handler event     .
// req(request)  res(response)

const gossipMiddleware = (req, res, next)=>{// 3  .
    console.log("I'm in the middle!");
    return res.send("lalall");
    next();//get    
}

const handleHome = (req, res)=>{// req  res .
    //next   .
    return res.end();//   .  request .
};

const handleLogin = (req, res)=>{
    return res.send("Login here");
}

app.use(gossipMiddleware);//app.use     .  ()  .
// use   get  .


app.get("/", handleHome);//get     . =>      ("/" ,   )
app.get("/login", handleLogin);
// handler(controler) .

const handleListening = () => console.log(`server listenting on port http://localhost:${PORT}`);

app.listen(PORT, handleListening); //      . // 4000  handleListening 

//3.6
